function [fitted,population] = GaMain(training,test)% creates a population of p,d,q solutionspopulation = randi([0,9],20,3);%initial fittness classificationfitted = Fitness(population,training,test);%Repeats algorithmn n timesn = 5;for i = 1:n    %finds 2 fittest chromosomes    selected = Selection(fitted);    crossed = Crossover(selected);        r = randi([1 100]);    if r <= 7                fitted = fitness(selected,training,test);endend